import { Container } from 'react-bootstrap'

import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./pages/HomePage"

function App() {
  return (
    <>
    <Header />
    <main class>
      <Container>
      <HomePage/>
      </Container>
    </main>
    <Footer/>

    </>
  );
}

export default App;
